const contentful = require("contentful");
import dotenv from 'dotenv'
dotenv.config()

const client = contentful.createClient({
    space: process.env.space,
    accessToken: process.env.accessToken,
    //space: process.env.space,
    //accessToken: process.env.accessToken,
});

export default client;
